import React from "react";
import Typewriter from "typewriter-effect/dist/core";

export default function Statement() {
  return new Typewriter("#statement", {
    strings: ["Hello", "World"],
    autoStart:
      "I specialize in transforming design concepts into seamless and engaging web applications",
    cursor: null,
    delay: 10,
  });
}
